import React, { useState } from "react";
import axios from 'axios';
import { PageHeader, Thumbnail, Media } from "react-bootstrap";
import "./profile.css";

export default function Profile(props) {
  const [firstName, setFirstName] = useState("Kevin");
  const [lastName, setLastName] = useState("Kim");
  const [biography, setBiography] = useState("Update your biography.");
  const [college, setCollege] = useState("San Jose State University");
  const [major, setMajor] = useState("Computer Science");
  const [skills, setSkills] = useState("");
  const [picture, setPicture] = useState("/profile.png");
  const [resume, setResume] = useState("");

  /*
      <div className="photo">
        <Thumbnail src={picture} />
      </div>
  */

  return (
    <div className="Profile">

      <PageHeader>Profile</PageHeader>

      <Media>
        <Media.Left>
          <img width={200} height={200} src={picture} />
        </Media.Left>
        <Media.Body>
          <Media.Heading>Kevin Kim</Media.Heading>
        </Media.Body>
      </Media>

    </div>
  );
}
